        borderRadius: 10,
        marginBottom: 10,
        height:70,
        borderLeftWidth: 2,
        borderRightWidth: 2,
        borderTopWidth: 2,
        borderBottomWidth: 2,
        borderColor: "#002D62",
        justifyContent: "center"
    },
    // TODO: Check names here and in ButtonStyle
